import React from "react";

// Import component
import Card from "./card";



function Forecast({inputText, forecasts}){
    return(
        <div>
            <div className="location-ttl"><h3>{inputText}</h3></div>

            <div className="cards-container">
                {forecasts.map((forecast) => (
                    <Card
                        key={forecasts.id}
                        day={forecast.day}
                        temp={forecast.temp}
                        clouds={forecast.clouds}
                        high={forecast.high}
                        low={forecast.low}
                    />
                ))
                }
            </div>
        </div>
    );
};

export default Forecast;
